import React, { useState, useEffect } from "react";
import { Routes, Route, Navigate } from "react-router-dom";
import Home from "./pages/Home";
import Dashboard from "./pages/Dashboard";
// import DashboardBis from "./pages/DashboardBis";
import Error from "./pages/Error";
import useFetch from "./service/service";
import "../src/App.css";

function App() {
  // const {user, loading, error} = useFetch(`http://localhost:3000/user/18`)

  // if(loading) return <h1>LOADING ...</h1>
  // if(error) console.log(error);


  const [user, setHouses] = useState([]);

  useEffect(() => {
    setHouses(useFetch);
  }, []);

  return (
    <>
      <Routes>
        <Route path="/" element={<Home user={user} />} />
        <Route path="/user/:id" element={<Dashboard />} />
        <Route path="/*" element={<Navigate to="/404" replace />} />
        <Route path="/404" excat={true} element={<Error />} />
      </Routes>
    </>
  );
}
export default App;
